import numpy as np


def write_np_matrix_c_array(f, tab_number, c_array, py_matrix):
    tab = "    "
    matrix_array = np.array(py_matrix)
    f.write(tab * tab_number + "memcpy(" + c_array + ", (double []){")
    for i in range(matrix_array.size):
        f.write(str(matrix_array.item(i)))
        if i < (matrix_array.size - 1):
            f.write(",")
    f.write("}," + str(matrix_array.size) + "* sizeof(double));\n")


def write_cimple_header(ctrl):
    """
    Create C header file, with the definition of the actions, to correspondant executive file.
    """
    f = StringIO()
    tab = "    "
    f.write("""//
// Autogenerated based on code by L. J. Feldstein
//

#ifndef CIMPLE_ACT_IMPL_H
#define CIMPLE_ACT_IMPL_H

#include <stdio.h>
#include "cimple_controller.h"

""")
    written_actions = []
    for trans_fro, trans_to, d in ctrl.transitions(data=True):

        if trans_to in written_actions:
            continue

        # Write action functions
        f.write(tab + "void ACT_" + str(
            trans_to) + "(current_state * now, discrete_dynamics * d_dyn, system_dynamics * s_dyn, cost_function * f_cost);\n\n")
        written_actions.append(trans_to)

    f.write("#endif //CIMPLE_ACT_IMPL_H")
    return f.getvalue()


def write_cimple_file(ctrl):
    """
    Create C implementation file

    Functions are only defined by the target cell. (Contrary to the python implementation
    that were defined based on start and end region.)
    """
    f = StringIO()
    tab = "    "
    f.write("""//
// Autogenerated based on code by L. J. Feldstein
//

#include <stdio.h>
#include "cimple_controller.h"

""")
    written_actions = []
    for trans_fro, trans_to, d in ctrl.transitions(data=True):

        if trans_to in written_actions:
            continue

        # Write action functions
        f.write("void ACT_" + str(
            trans_to) + "(current_state * now, discrete_dynamics * d_dyn, system_dynamics * s_dyn, cost_function * f_cost){\n")
        f.write(tab + "int target_cell =" + str(trans_to) + ";\n")
        f.write(tab + """printf("Computing control sequence to go from cell %d to cell """ + str(
            trans_to) + """...", (*now).current_cell);\n""")
        f.write(tab + "fflush(stdout);\n\n")
        f.write(tab + "gsl_matrix * u = gsl_matrix_alloc(now->x->size, d_dyn->time_horizon);\n")
        f.write(tab + "get_input(u, now, d_dyn, s_dyn, target_cell, f_cost);\n")
        f.write(tab + """printf("Applying it...");\n""")
        f.write(tab + "fflush(stdout);\n")
        f.write(tab + "apply_control(now->x, u, s_dyn->A, s_dyn->B);\n")

        f.write(tab + """printf("New state:");\n""")
        f.write(tab + """gsl_vector_print(now->x, "now->");\n""")

        # // int current_cell = find_discrete_state(now->x, now->d_dyn.ppp);
        # // TODO:printf("That is in discrete cell %d", now->current_cell);
        f.write(tab + "fflush(stdout);\n")
        f.write(tab + "// Clean up!\n")
        f.write(tab + "gsl_matrix_free(u);\n")
        f.write("}")
        f.write("\n\n")
        written_actions.append(trans_to)

    # def sample_in_region(self, P):
    #        # Currently only (polytopes or singleton regions) and 1-D polytopes supported.
    #        if isinstance(P, pc.Region):
    #            assert len(P) == 1
    #            P = P[0]
    #        assert isinstance(P, pc.Polytope)
    #        V = pc.extreme(P)
    #        assert V.shape == (2,1) or V.shape == (1,2)
    #        return np.random.random((1,))*(V[1]-V[0]) + V[0]

    return f.getvalue()


def write_init_file(ctrl, sys_dyn, disc_dynamics, N=5, ordinance=2, mid_weight=0.0, name="cimpl"):
    """
    Initialization of all constant system variables:
    C matrices and other variables (e.g. system dynamics, polytopes, time horizon...)
    are created from arrays based on the python files.
    Initial state is put into a struct which is continuously modified by functions defined in 'act_impl.c'
    to move into the respective polytope.
    :param ctrl:
    :param sys_dyn:
    :param disc_dynamics:
    :param N:
    :param ordinance:
    :param mid_weight:
    :param name:
    :return:
    """
    from scipy import linalg as lg
    import polytope as pc
    f = StringIO()
    tab = "    "
    x0 = np.zeros(sys_dyn.A.shape[1])
    disturbance_ind = range(1, N)
    ######int main#########
    # R, Q, r

    R = None
    Q = None
    r = None
    if (
                            R is None and
                            Q is None and
                        r is None and
                    mid_weight == 0):
        # Default behavior
        Q = np.eye(N * sys_dyn.B.shape[1])
        R = np.zeros([N * x0.size, N * x0.size])
        r = np.zeros([N * x0.size, 1])
        mid_weight = 3
    if R is None:
        R = np.zeros([N * x0.size, N * x0.size])
    if Q is None:
        Q = np.eye(N * sys_dyn.B.shape[1])
    if r is None:
        r = np.zeros([N * x0.size, 1])

    if (R.shape[0] != R.shape[1]) or (R.shape[0] != N * x0.size):
        raise Exception("get_input: "
                        "R must be square and have side N * dim(state space)")

    if (Q.shape[0] != Q.shape[1]) or (Q.shape[0] != N * sys_dyn.B.shape[1]):
        raise Exception("get_input: "
                        "Q must be square and have side N * dim(input space)")

    # LU, MU, GU, An, Ak, Uset, E_default, L_default, K_hat

    A = sys_dyn.A
    B = sys_dyn.B
    E = sys_dyn.E
    K = sys_dyn.K

    D = sys_dyn.Wset
    PU = sys_dyn.Uset

    n = A.shape[1]  # State space dimension
    m = B.shape[1]  # Input space dimension
    p = E.shape[1]  # Disturbance space dimension

    LUn = np.shape(PU.A)[0]
    L_default = np.zeros([n * N, n + (m * N)])
    E_default = np.zeros([n * N, p * N])
    LU = np.zeros([LUn * N, n + N * m])

    MU = np.tile(PU.b.reshape(PU.b.size, 1), (N, 1))

    GU = np.zeros([LUn * N, p * N])

    K_hat = np.tile(K, (N, 1))

    B_diag = sys_dyn.B
    E_diag = sys_dyn.E
    for i in range(N - 1):
        B_diag = lg.block_diag(B_diag, B)
    for i in range(N - 1):
        E_diag = lg.block_diag(E_diag, E)

    A_it = sys_dyn.A.copy()
    A_row = np.zeros([n, n * N])
    A_K = np.zeros([n * N, n * N])
    A_N = np.zeros([n * N, n])

    for i in range(N):
        A_row = sys_dyn.A.dot(A_row)
        A_row[np.ix_(
            range(n),
            range(i * n, (i + 1) * n)
        )] = np.eye(n)

        A_N[np.ix_(
            range(i * n, (i + 1) * n),
            range(n)
        )] = A_it

        A_K[np.ix_(
            range(i * n, (i + 1) * n),
            range(A_K.shape[1])
        )] = A_row

        A_it = sys_dyn.A.dot(A_it)
    Ct = A_K.dot(B_diag)

    A_n = np.eye(n)
    A_k = np.zeros([n, n * N])

    for i in range(N + 1):

        ######### FOR G #########
        if i in disturbance_ind:

            idx = np.ix_(
                range(n * i, n * (i + 1)),
                range(E_default.shape[1])
            )
            E_default[idx] = A_k.dot(E_diag)

            if (PU.A.shape[1] == m + n) and (i < N):
                A_k_E_diag = A_k.dot(E_diag)
                d_mult = np.vstack([np.zeros([m, p * N]), A_k_E_diag])

                idx = np.ix_(range(LUn * i, LUn * (i + 1)), range(p * N))
                GU[idx] = PU.A.dot(d_mult)

        ######### FOR L #########
        AB_line = np.hstack([A_n, A_k.dot(B_diag)])

        if i >= N:
            continue

        idx = np.ix_(
            range(n * i, n * (i + 1)),
            range(L_default.shape[1])
        )
        L_default[idx] = AB_line
        if PU.A.shape[1] == m:
            idx = np.ix_(
                range(i * LUn, (i + 1) * LUn),
                range(n + m * i, n + m * (i + 1))
            )
            LU[idx] = PU.A
        elif PU.A.shape[1] == m + n:
            uk_line = np.zeros([m, n + m * N])

            idx = np.ix_(range(m), range(n + m * i, n + m * (i + 1)))
            uk_line[idx] = np.eye(m)

            A_mult = np.vstack([uk_line, AB_line])

            b_mult = np.zeros([m + n, 1])
